import React from 'react';
import "../src/css/lan.css";
function Lan() {
  return (
    <div className='lanm'>
      <div className='lanb'>
        <div className='dcil'>NAME :</div>
        <div className='dcil'>DEPARTMENT :</div>
        <div className='dcil'>COLLEGE :</div>
        <button className='dcil'>IN</button>
      </div>
    </div>
  )
}
export default Lan
